package fileutil

import (
	"bytes"
	"crypto/md5"
	"fmt"
	"io"
	"testing"
)

func TestReadFile(t *testing.T) {
	fmt.Println(ReadFile("/tmp/df.sh"))
}

func TestGetScriptFileContent(t *testing.T) {
	// 下面是c语言输出hello world的二进制的base64后的编码信息, md5值为： cc7a49e2b705a57040254e3af118b58c
	data := `data:application/octet-stream;base64,`

	binary, err := GetDataURI([]byte(data))
	if err != nil {
		t.Errorf("get script file content error %s", err)
	}

	buff := bytes.NewBuffer(binary)

	h := md5.New()
	io.Copy(h, buff)

	v := h.Sum(nil)
	md5Value := fmt.Sprintf("%x", v)
	t.Log(md5Value)

	if md5Value != "cc7a49e2b705a57040254e3af118b58c" {
		t.Error("not valid md5 content")
	}

}
